import React, {Component} from 'react';
import History from './History'

class ResultHistory extends Component{
    render(){
        let {history} = this.props;
        return(
            <div className="result-history">
                <div className="history">
                    <div>{history}</div>
                </div>
            </div>
        )
    }
}

export default ResultHistory;
